@Walter Ω Omegael Muitos governos não levaram a sério, não por não saberem as reais consequências da pandemia, mas por serem reféns dos empresários gananciosos que não querem parar a ecónomia e estão dispostos a sacrificar vidas humanas!
Todos os países na lista das democracias mais transparentes do mundo, estão a ser os países com mais êxito no combate à pandemia, e isso acontece porque os governos desses países não devem favores aos empresários e trabalham apenas em prol da população...
Governos democráticos como os da Itália, França, Reino Unido, Espanha, EUA, Brasil, entre outros, são uma vergonha para o mundo e o povo não pode deixar de culpar esses governos pela tragédia que as políticas deles causaram ao próprio povo!

